import React from 'react';
import { Container,Row,Col} from 'react-bootstrap'
import './LandingPage.css';
import img from '../../../../public/bg3.jpg';

const LandingPage = () =>{
    return(
        <div>
            <img src="../../../../public/bg3.jpg"/>
            <Row>
                <Col><img src="../../../../public/bg3.jpg"/></Col>
                <Col>
                    <Row>LOGIN</Row>
                    <Row>SIGNUP</Row>
                </Col>
            </Row>
            
        </div>
        
    )
}

export default LandingPage;
